// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface PoolInterface {
    function getReserves()
        external
        returns (
            uint112,
            uint112,
            uint32
        );

    function token0() external returns (address);

    function token1() external returns (address);
}

interface DecimalsInterface {
    function decimals() external returns (uint8);
    function name() external returns (string calldata);
}

contract RateFromPool {

    PoolInterface poolConsumer;
    DecimalsInterface decimalsConsumerOne;
    DecimalsInterface decimalsConsumerTwo;


    function addPoolFeed(address _poolConsumerInterfaceAddress)
        public
    {
        poolConsumer = PoolInterface(
            _poolConsumerInterfaceAddress
        );
    }


    function PoolRate() public returns ( uint256, uint256, string memory ) {
        (uint256 tokenOne, uint256 tokenTwo, ) = poolConsumer.getReserves();
        address tokenOneAddress = poolConsumer.token0();
        address tokenTwoAddress = poolConsumer.token1();

        decimalsConsumerOne = DecimalsInterface(tokenOneAddress);
        decimalsConsumerTwo = DecimalsInterface(tokenTwoAddress);
        uint256 decimalsOne = decimalsConsumerOne.decimals(); 
        uint256 decimalsTwo = decimalsConsumerTwo.decimals(); 
        string memory nameOne = decimalsConsumerOne.name();
        string memory nameTwo = decimalsConsumerTwo.name();


        return calculatePoolRate(
            tokenOne,
            decimalsOne,
            nameOne,
            tokenTwo,
            decimalsTwo,
            nameTwo
        );

    }

     function calculatePoolRate(

        uint256 tokenOne, 
        uint256 decimalOne, 
        string memory tokenOneName, 
        uint256 tokenTwo, 
        uint256 decimalTwo, 
        string memory tokenTwoName

        ) private pure returns (uint256, uint256, string memory) {
        require(bytes(tokenOneName).length>0 && bytes(tokenTwoName).length>0, "Missing input for token names!");
        require(decimalOne <= 18 && decimalTwo <= 18, "Decimals should be less than or equal to 18");
        require(decimalOne > 0 && decimalTwo > 0, "Decimals should be greater than 0");
        require(tokenOne > 0 && tokenTwo > 0, "Token values should be greater than 0");

        if (decimalOne > decimalTwo) {
            uint256 tokenTwoconverted = tokenTwo * 10**(decimalOne - decimalTwo);
            if (tokenOne > tokenTwoconverted) {
                return ((tokenOne*10**8 / tokenTwoconverted*10**8)/10**8, 8, string.concat(tokenOneName, "/", tokenTwoName));
            } else {
                return ((tokenTwoconverted*10**8 / tokenOne*10**8)/10**8, 8, string.concat(tokenTwoName, "/", tokenOneName));
            }
        } else {
            uint256 tokenOneconverted = tokenOne * 10**(decimalTwo - decimalOne);
            if (tokenTwo > tokenOneconverted) {
                return ((tokenTwo*10**8 / tokenOneconverted*10**8)/10**8, 8, string.concat(tokenTwoName, "/", tokenOneName));
            } else {
                return ((tokenOneconverted*10**8 / tokenTwo*10**8)/10**8, 8,string.concat(tokenOneName, "/", tokenTwoName));
            }
        }
    }
}

